(508, 1, '2020-02-15 18:58:02', '2020-02-15 18:58:02', '<img class=\"alignnone size-medium wp-image-498 aligncenter\" src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/G.-UMAMAHESWAR-CHAIRMAN-252x300.jpeg\" alt=\"\" width=\"252\" height=\"300\">\n<p style=\"text-align: center;\">G UMAMAHESWAR, M.Sc.,(Physics), M.Ed., M.B.A., (Ph.D.)</p>\n<p style=\"text-align: center;\">CHAIRMAN</p>\nCreating the next generation of management thinkers, Sri Vidya Degree College &amp;MBA in Puttur, Chittoor was established a while ago. This institute is on a path to create and nurture thought leaders and entrepreneurs by means of inventive educational infrastructure and facilities. Forming the backbone of this esteemed institute is the management team, which is a team of driven professionals and industry experts who have continuously worked towards the development of the students. By providing infrastructure and facilities imperative for learning and development, this B-school focuses on multiple inventive educational methods by offering practical, innovative and technology-driven courses and programs. The success of this institute lies in the success of its students; a testimony to this is the ever-growing alumni base. On a wider scheme of things, this management college aspires to make a significant contribution to India\'s corporate sphere by moulding bright management graduates with a global mindset. You can find this center with ease on By Pass Rd, Govindapalyam. This listing is also listed in MBA Colleges.', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2022-04-06 07:39:24', '2022-04-06 07:39:24', '', 0, 'https://www.sreevidyacolleges.com/?page_id=508', 0, 'page', '', 0),
