(523, 1, '2020-02-15 19:27:23', '2020-02-15 19:27:23', '<!-- wp:paragraph -->\n<p><strong>FACILITIES</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>1. LAB</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong> 2. BUS</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>3. LIBRARY</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>               E - Journals</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>4.&nbsp;PLAY GROUND</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>5. RO SYSTEM</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>6. WIFI</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">The campus of Sree Vidya Degree College &amp;MBA in Puttur boasts of the best-in-class infrastructure and amenities that are second to none. This institute\'s campus creates a conducive atmosphere for local students as well as students coming to study from different parts of the country. The classrooms are equipped with state-of-the-art equipment for conducting lectures and explaining the concepts of management. This institute takes special pride in their teaching staff, who are quite experienced and knowledgeable in the various management specializations. Various post-graduate programmes are offered by this institute. After meeting the specific prerequisites, students can apply for any of these management programmes on the basis of the multiple specializations offered. A dedicated placement counsellor assists the students with placement options and career opportunities with employers and organisations, nearing the completion of the course. Visit the campus from 09:30 - 18:30.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":575} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/chemistry-lab-300x193.jpg\" alt=\"\" class=\"wp-image-575\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":576} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/COLLEGE-BUS-183x300.jpeg\" alt=\"\" class=\"wp-image-576\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong><strong></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":579} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/PLAY-GROUND-GIRLS-300x169.jpg\" alt=\"\" class=\"wp-image-579\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"align\":\"left\",\"id\":578} -->\n<div class=\"wp-block-image\"><figure class=\"alignleft\"><img src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/LIBRARY-300x150.jpg\" alt=\"\" class=\"wp-image-578\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'FACILITIES', '', 'draft', 'closed', 'closed', '', 'facilities', '', '', '2023-09-02 08:16:41', '2023-09-02 08:16:41', '', 0, 'https://www.sreevidyacolleges.com/?page_id=523', 0, 'page', '', 0),
(524, 1, '2020-02-15 19:16:30', '2020-02-15 19:16:30', 'The college conducts its programs and activities guided by overarching Vision, Mission, Goals, Values, Beliefs statements. All are revisited periodically and revised, if appropriate.\r\n<h3><b>Vision:</b></h3>\r\n&nbsp;\r\n\r\nThe College will be a world leader in the integration of\r\n(a) Teaching and learning,\r\n(b) Advancement of the knowledge base through research and scholarship,\r\n(c) Leadership in service and outreach.\r\nFurther, the College will be a world leader in preparing professionals who provide leadership and exemplary educational and related services to improve the lives of individuals in a changing and complex global society.\r\n<h3><b>Mission:</b></h3>\r\n&nbsp;\r\n\r\nThe mission of the College is to help prepare outstanding educators, scholars, and researchers, and to advance the profession of education, as broadly defined, through research on the science and art of teaching and learning, the application of clinical processes, the effective uses of technology, and the analysis and development of leadership and educational policy.', 'Vision and Mission', '', 'publish', 'closed', 'closed', '', 'vision-and-mission', '', '', '2020-02-15 19:16:30', '2020-02-15 19:16:30', '', 0, 'https://www.sreevidyacolleges.com/?page_id=524', 0, 'page', '', 0),
(525, 1, '2020-02-15 19:16:30', '2020-02-15 19:16:30', 'The college conducts its programs and activities guided by overarching Vision, Mission, Goals, Values, Beliefs statements. All are revisited periodically and revised, if appropriate.\r\n<h3><b>Vision:</b></h3>\r\n&nbsp;\r\n\r\nThe College will be a world leader in the integration of\r\n(a) Teaching and learning,\r\n(b) Advancement of the knowledge base through research and scholarship,\r\n(c) Leadership in service and outreach.\r\nFurther, the College will be a world leader in preparing professionals who provide leadership and exemplary educational and related services to improve the lives of individuals in a changing and complex global society.\r\n<h3><b>Mission:</b></h3>\r\n&nbsp;\r\n\r\nThe mission of the College is to help prepare outstanding educators, scholars, and researchers, and to advance the profession of education, as broadly defined, through research on the science and art of teaching and learning, the application of clinical processes, the effective uses of technology, and the analysis and development of leadership and educational policy.', 'Vision and Mission', '', 'inherit', 'closed', 'closed', '', '524-revision-v1', '', '', '2020-02-15 19:16:30', '2020-02-15 19:16:30', '', 524, 'https://www.sreevidyacolleges.com/2020/02/15/524-revision-v1/', 0, 'revision', '', 0),
