(599, 1, '2020-02-15 19:46:56', '2020-02-15 19:46:56', '<strong>FACILITIES</strong>\n\n<strong>1.LAB</strong>\n\n<strong> 2.BUS</strong>\n\n<strong>3.LIBRARY</strong>\n\n<strong>4  .PLAY GROUND</strong>\n\n<strong>5.RO SYSTEM</strong>\n\n<strong>6.WIFI</strong>\n<p style=\"text-align: left;\">The campus of Sree Vidya Degree College &amp;MBA in Puttur boasts of the best-in-class infrastructure and amenities that are second to none. This institute\'s campus creates a conducive atmosphere for local students as well as students coming to study from different parts of the country. The classrooms are equipped with state-of-the-art equipment for conducting lectures and explaining the concepts of management. This institute takes special pride in their teaching staff, who are quite experienced and knowledgeable in the various management specializations. Various post-graduate programmes are offered by this institute. After meeting the specific prerequisites, students can apply for any of these management programmes on the basis of the multiple specializations offered. A dedicated placement counsellor assists the students with placement options and career opportunities with employers and organisations, nearing the completion of the course. Visit the campus from 09:30 - 18:30.</p>\n<p style=\"text-align: left;\"><strong><img class=\"alignnone size-medium wp-image-575\" src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/chemistry-lab-300x193.jpg\" alt=\"\" width=\"300\" height=\"193\" />         </strong><strong><img class=\"alignnone  wp-image-576\" src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/COLLEGE-BUS-183x300.jpeg\" alt=\"\" width=\"120\" height=\"197\" /></strong>\n\n</p>\n<strong>         <img class=\"alignnone  wp-image-579\" src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/PLAY-GROUND-GIRLS-300x169.jpg\" alt=\"\" width=\"240\" height=\"135\" /></strong><img class=\" wp-image-578 alignleft\" src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/LIBRARY-300x150.jpg\" alt=\"\" width=\"260\" height=\"130\" />', 'FACILITIES', '', 'inherit', 'closed', 'closed', '', '523-revision-v1', '', '', '2020-02-15 19:46:56', '2020-02-15 19:46:56', '', 523, 'https://www.sreevidyacolleges.com/2020/02/15/523-revision-v1/', 0, 'revision', '', 0),
