(870, 1, '2023-09-02 07:48:02', '2023-09-02 07:48:02', '<!-- wp:paragraph -->\n<p><strong>FACILITIES</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>1. LAB</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong> 2. BUS</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>3. LIBRARY</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>4.&nbsp; PLAY GROUND</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>5. RO SYSTEM</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>6. WIFI</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">The campus of Sree Vidya Degree College &amp;MBA in Puttur boasts of the best-in-class infrastructure and amenities that are second to none. This institute\'s campus creates a conducive atmosphere for local students as well as students coming to study from different parts of the country. The classrooms are equipped with state-of-the-art equipment for conducting lectures and explaining the concepts of management. This institute takes special pride in their teaching staff, who are quite experienced and knowledgeable in the various management specializations. Various post-graduate programmes are offered by this institute. After meeting the specific prerequisites, students can apply for any of these management programmes on the basis of the multiple specializations offered. A dedicated placement counsellor assists the students with placement options and career opportunities with employers and organisations, nearing the completion of the course. Visit the campus from 09:30 - 18:30.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":575} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.sreevidyacolleges.com/wp-content/uploads/2020/02/chemistry-lab-300x193.jpg\" alt=\"\" class=\"wp-image-575\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\